function beautify(t,e){if(t>=1e6){var r=Math.floor(logFloor(t)/3),i=beautify(t/Math.pow(10,3*r),e);return i+""+prefixes[r-2]}return numberWithCommas(t.toFixed(e))}function numberWithCommas(t){var e=t.toString().split(".");return e[0].replace(/\B(?=(\d{3})+(?!\d))/g,",")+(e[1]?"."+e[1]:"")}function logFloor(t){for(var e=0;t>=10;)e++,t/=10;return e}function fix(t,e){return 0==e?beautify(t,0):2==e?t>=1e6?beautify(t,3):beautify(t,2):3==e?t>=1e6?beautify(t,3):beautify(t,0):void 0}var prefixes=["m ","b ","t ","q ","Q ","s ","S ","o ","n ","D ","UD ","DD ","TD ","qD ","QD ","sD ","SD ","OD ","ND ","V ","UV ","DV ","TV ","qV ","QV ","sV ","SV ","OV ","NV ","T ","UT ","DT ","TT ","qT ","QT ","sT ","ST ","OT ","NT ","~q ","Uq ","Dq ","Tq ","qq ","Qq ","sq ","Sq ","Oq ","Nq "];